import React, { Component } from 'react'
import { Grid, Cell} from 'react-mdl'
import OneCard from './Cards'
import image from '../java-img.png'
import reactimage from '../react2.png'

class Projects extends Component {
    render() {
        return (
            <div style={{ width: '100%', margin: 'auto'}}>
                <Grid className="landing-grid">
                    <Cell col={12}>
                        <OneCard link={reactimage} name={`Portfolio`} info={'This website itself'}/>
                        <OneCard link={image} name={'Java Project'} info={'Volleyball Stat Tracking App'}/>
                    </Cell>
                </Grid>
            </div>
        )
    }
}

export default Projects
